def iterate_games(fn):

    return iter(
        filter(
            lambda x: x.strip() != "",
            (
                "\n".join(
                    filter(
                        lambda x: x != "",
                        [' '.join(x.strip().split())
                         for x in fn.open().readlines()]
                        )
                    )
            ).rstrip("-").split("---\n")
            )
