def sig_fig_error(digits):

    integral, _, fractional = digits.partition(".")
    if fractional:
        num = '0.{}5'.format('0' * len(fractional))
        return float(num)
    elif int(integral) == 0:
        return 0.5
    else:
        to_the = len(integral) - len(integral.rstrip('0'))
        return pow(10, to_the) / 2.0

