import torch

def dual_focal_loss_proto(pred, label, reduction='mean', avg_factor=None):

    assert reduction in ['none', 'mean', 'sum']
    label = label.type_as(pred)
    pred_sigmoid = pred.sigmoid()
    l1 = torch.abs(label - pred_sigmoid)
    loss = l1 - (1.0 - l1).log()
    if reduction == 'none':
        return loss
    elif reduction == 'mean':
        if avg_factor is None:
            return loss.mean()
        else:
            return loss.sum() / avg_factor
    else:
        return loss.sum()

def check_is_hashable(py_obj):


    try:
        py_obj.__hash__()
        return True
    except TypeError:
        return False

def turn(orient_index, direction):

    if direction == 'R':
        orient_index += 1
        if orient_index == 4:
            orient_index = 0
    else:
        orient_index -= 1
        if orient_index == -1:
            orient_index = 3
    return orient_index

