    if isinstance(item, (list, tuple)):
        return tuple(item)
    return (item,) if item is not None else None

def comp(z1, z2, tol):

    if not z1:
        z1, z2 = z2, z1
    if not z1:
        return True
    diff = abs(z1 - z2)
    az1 = abs(z1)
    if z2 and az1 > 1:
        return diff/az1 <= tol
    else:
        return diff <= tol

