def format_size(bytes):


    if bytes > 1000000:
        return '%.1fMB' % (bytes / 1000000.0)

    if bytes > 10 * 1000:
        return '%ikB' % (bytes / 1000)

    if bytes > 1000:
        return '%.1fkB' % (bytes / 1000.0)

    return '%ibytes' % bytes

def pkt_line(data):

    if data is None:
        return b'0000'
    return ('%04x' % (len(data) + 4)).encode('ascii') + data

